import React from "react";
import Todo from "../todo/todo";
import {ITask} from "../../models/interface/interface";

interface TodosComponentProp {
    todos: ITask[]
    btnTodoRemove: (id: string) => void
}

export const TodosComponent = ({todos, btnTodoRemove}:TodosComponentProp): JSX.Element  => {

    return (
        <div className='task-container'>
            {todos.map(todo =>
                <Todo todo={todo} key={todo.id} btnTodoRemove={btnTodoRemove}/>
            )}
        </div>
    )
}
